import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { AuthProvider, useAuth } from './context/AuthContext';
import { AppProvider } from './context/AppContext';
import './App.css';

// Components
import Header from './components/Common/Header';
import Footer from './components/Common/Footer';
import Loading from './components/Common/Loading';

// Pages
import HomePage from './components/Home/HomePage';
import Login from './components/Auth/Login';
import Register from './components/Auth/Register';

// User Panel
import UserDashboard from './components/UserPanel/UserDashboard';
import InstituteList from './components/UserPanel/InstituteList';
import InstituteDetail from './components/UserPanel/InstituteDetail';

// Institute Dashboard
import InstituteDashboard from './components/InstituteDashboard/InstituteDashboard';
import ProfileManagement from './components/InstituteDashboard/ProfileManagement';
import CourseManagement from './components/InstituteDashboard/CourseManagement';
import FacilitiesManagement from './components/InstituteDashboard/FacilitiesManagement';
import Enquiries from './components/InstituteDashboard/Enquiries';
import Reviews from './components/InstituteDashboard/Reviews';

// Admin Panel
import AdminDashboard from './components/AdminPanel/AdminDashboard';
import ManageInstitutes from './components/AdminPanel/ManageInstitutes';
import ManageUsers from './components/AdminPanel/ManageUsers';
import AnalyticsDashboard from './components/AdminPanel/AnalyticsDashboard';

// App Content Component
const AppContent = () => {
  const { user, loading, userType } = useAuth();

  if (loading) {
    return <Loading />;
  }

  return (
    <div className="App">
      <Header />
      <main className="main-content">
        <Routes>
          {/* Public Routes */}
          <Route path="/" element={<HomePage />} />
          <Route path="/login" element={!user ? <Login /> : <Navigate to={`/${userType}/dashboard`} />} />
          <Route path="/register" element={!user ? <Register /> : <Navigate to={`/${userType}/dashboard`} />} />
          <Route path="/institutes" element={<InstituteList />} />
          <Route path="/institute/:id" element={<InstituteDetail />} />

          {/* User Routes */}
          <Route path="/user/dashboard" element={user && userType === 'user' ? <UserDashboard /> : <Navigate to="/login" />} />

          {/* Institute Routes */}
          <Route path="/institute/dashboard" element={user && userType === 'institute' ? <InstituteDashboard /> : <Navigate to="/login" />} />
          <Route path="/institute/profile" element={user && userType === 'institute' ? <ProfileManagement /> : <Navigate to="/login" />} />
          <Route path="/institute/courses" element={user && userType === 'institute' ? <CourseManagement /> : <Navigate to="/login" />} />
          <Route path="/institute/facilities" element={user && userType === 'institute' ? <FacilitiesManagement /> : <Navigate to="/login" />} />
          <Route path="/institute/enquiries" element={user && userType === 'institute' ? <Enquiries /> : <Navigate to="/login" />} />
          <Route path="/institute/reviews" element={user && userType === 'institute' ? <Reviews /> : <Navigate to="/login" />} />

          {/* Admin Routes */}
          <Route path="/admin/dashboard" element={user && userType === 'admin' ? <AdminDashboard /> : <Navigate to="/login" />} />
          <Route path="/admin/institutes" element={user && userType === 'admin' ? <ManageInstitutes /> : <Navigate to="/login" />} />
          <Route path="/admin/users" element={user && userType === 'admin' ? <ManageUsers /> : <Navigate to="/login" />} />
          <Route path="/admin/analytics" element={user && userType === 'admin' ? <AnalyticsDashboard /> : <Navigate to="/login" />} />

          {/* Fallback Route */}
          <Route path="*" element={<Navigate to="/" />} />
        </Routes>
      </main>
      <Footer />
    </div>
  );
};

// Main App Component
function App() {
  return (
    <AuthProvider>
      <AppProvider>
        <Router>
          <AppContent />
        </Router>
      </AppProvider>
    </AuthProvider>
  );
}

export default App;
